import React from 'react'
import {Container} from 'react-bootstrap'
const homeLanding = () => {
    return (
        <div>
           <Container>
           <h3>North America's Top Ranking</h3>
            <h1>Digital Marketing Agency</h1>
           </Container>
        </div>
    )
}

export default homeLanding
